text:
@quantick My favourite anagrams out of names are two people who used to date...

Britney Spears: Presbyterians
Justin Timberlake: Miserable Tit Junk

@alicearnold1 What I didn't realise until I saw it was where the houses were situated - on the very island where I lived.

Indeed, the sunset from the music teacher's house looked out onto the island opposite where my mum's ashes are scattered.

I'm still in pieces - albeit uplifted pieces.

@amykelloggfox Thinking of you today with the horrible news about Pierre, Ben and your fixer. 

Annoyed at myself (especially given the tributes to his remarkable courage) that I never said anything more to Pierre than "hi".

Hope you're OK. Stay safe and well!

@SebastianEPayne @RMCunliffe @BenedictSpence Not strictly my domain anymore, Seb (not to mention above my pay-grade as a decision!). 

As of this week, I'm filling in on papers here and there, but now chiefly working on our new 9pm progs.

(And if I was there that night, no wonder you were haunted!)

@kyle_rushford Hello Kyle - - Max from Sky News here. 

Could we please use this footage on our evening news bulletins? We would, of course, give you an on-screen credit.

Thanks!

@DonnaC_Marshall Hello Donna - Max from Sky News here.

Could we please use this footage on our evening news bulletins? We would, of course, give you an on-screen credit.

Thanks!

@Lucy_Webster_ Tell me about it...

OT turns up 45 mins early for an appointment. I'm stark-naked coming out of the shower. The excuse yelled from the other side of the door was that she'd finished her other appointments early and figured I'd be free.

Our time does seem to matter less.

@MartinSLewis Hi Martin - long time no speak!

How will it work given I'm due to move from Home A to Home B (in two different boroughs) literally at the change of the council tax year and with Home B having a mandated collective energy supplier for the building? 

Can I claim retrospectively?

@jimmycarr Technically, Jimmy, the production team have libelled you!

Tax evasion is a crime. Tax avoidance isn't.

Thoughts, @richardpbacon? ü§£

@IanDunt I once made fun of said presenter in a tweet where I hadn't @'d him.

Nevertheless, he responded almost immediately, warning ominously that I would "regret this".

His reply generated a grand total of nine likes and zero abusive missives towards me from his acolytes.

@wallaceme @NoContextBrits My own personal favourite...

Q: "What was the name of Phillip Schofield's furry children's TV sidekick?"

A (quizzically): "Emma Forbes?!"

@PlexNetflix @ar_mu I might beg to differ.

Though, last time I did something for Sky, a guy tweeted to tell me: "You look like Stephen Hawking with Down's Syndrome".

I replied: "And how else do you find me sexy?"

@WhichPennySmith @ScalaRadio No, but mostly because I'm allergic to cats. So's my girlfriend, but - glutton for punishment that she is - she still wants one.

Wonder if concession on my part might be a way of ensuring we're together forever. 

Cheers for that, Penny - wouldn't have got there without you!

@MitchBenn In 2010, I was thrown onto air as work experience on "Today in Parliament" to voice a pre-rec on vaccinating badgers against bovine TB (!!!)

Later, listening back at home as it went out, they back-anno'd with: "Max Preston reporting there..."

I burst into joyful tears.

@skynewsniall @robpowellnews @marthakelner A music-agent friend of mine once took his client to Guy Ritchie's house to discuss the possibility of contributing a song to his film.

The erstwhile Mrs R walks into the sitting room, shakes my friend's hand and declares: "Hello, I'm Madonna".

Always impressed me she did that.

@Lucy_Webster_ Well done!

I passed by one point and am now somehow allowed to extensively produce newspaper reviews on live TV, where knowledge of media law is integral.

Amazing where life takes you!

@thecarolemalone Yesterday, someone randomly tweeted back after my announcement of the new Press Preview format to say he wouldn't watch "that shrill harpy Carole Malone if she's on it".

1. I note he didn't have the cojones to @ you.

2. He's not gonna like Thursday!

@ajcdeane The thing is... these people *may* be right that GBN won't be balanced and will rightly incur Ofcom's wrath.

But in their state of high-dudgeon, they're proving the point about inhibition of free speech.

And that's before we get to JHB, NF and RJ not (yet) working there!

@wallaceme @soniasodha No, it isn't, because you wouldn't say "join I".

It would only be "and I" if "I" is what you would use in the singular absent the other person.

And yes, I AM being this boring in an attempt to help you get some sleep!

@DAaronovitch @AndrewMarr9 "He {HRH] would always trail two steps behind the Queen - like an Indian bride, as they say."

Really?! Who's "they"?!

And to an Asian presenter, no less.

@billybagginz @SkyNews Then it wasn't blank, was it?

You could've chosen to be helpful, like hundreds of others. Instead, you opted for this.

I'd rather be imprecise than unkind.

@ChrisCillizza Ya think that's a doozy?...

I (a bespectacled wheelchair user) once got a tweet from a viewer telling me: "You look like Stephen Hawking with Down's Syndrome."

I duly replied: "And how else do you find me sexy?"

@thecarolemalone It defied sense.

"I know... let's set fire to a police van and break some coppers' bones in defence of our right to peacefully protest. That will SURELY make them relent on this bill, cuz we know Priti Patel's a softie!"

*rolls eyes so far back they might as well be in Bristol*

@hendopolis @jessbrammar It's usually...

"Harry's Bunions Perfectly Fine, If A Little Misguided"

"MEGHAN'S BUNIONS A THREAT TO OUR CONTINUED EXISTENCE, FOR SOME REASON!!!"

@thegarethmclean All three are valued former colleagues.

Once did a karaoke duet of "Try A Little Tenderness" with Sarah - and Martha co-signed my NUJ application.

At least, I THINK it was that way round!

@tvlive Is that REALLY his name?!

If the trend of odd tweets from presidential election losers continues, expect to hear from Trump in 2052.

(Actually, probably sooner - he'll have time on his hands!)

@skynewssarah @JayneSeckerSky I once played the lead role of a cockerel in a musical.

I shared a dressing room with the play's narrator, Michael Aspel, who told me Zsa Zsa Gabor once leapt on him on live TV and bombarded him with kisses.

I shall use this when I'm on "Would I Lie To You?"

@quantick TELL ME you've seen this...

https://t.co/xQhk4ZpWFC

I also recommend Chas and Dave singing "Mad World" and Bryan Ferry and Robert Smith's duet of "Shaddapayaface".

PROGRAMMING NOTE: Due to a day of significant #Covid19 announcements, tonight's edition of @SkyNews at Ten will be extended by 15 mins.

@markaustintv will present from Liverpool, with @annabotting back at HQ.

#SkyPapers follows at 2245 &amp; 2330 with @wallaceme &amp; @NancyFielder.

We're on-air from 1:30am BST on @SkyNews with special live coverage of the first debate in #USElection2020.

@GregMilamSky anchors live from Cleveland - with special guests @OMAROSA, @KellyRiddell and @theonlyhonest (Michael Starr Hopkins)

https://t.co/3jPAKVcJcM
